                    <td><Link className="text-dark" to={item.attributes.link_consulta} state={{ from: from }}><small>Completar informaci贸n</small></Link></td>
                </tr>
            )
         
        }
    }

    const tablaFases = () => {

        if (getListaAntecedentes.data != null && typeof (getListaFases.data) != 'undefined') {
            return (

                getListaFases.data.map((item, i) => {
                    return (
                        <tr>
                            <td>{i=i+1}</td>
                            <td>{item.attributes.nombre}</td>
                            <td><Link className="text-dark" to={item.attributes.link_consulta} state={{ from: from }}><small>Completar informaci贸n</small></Link></td>
                        </tr>
                    )
                })
            )
        }
    }

    return (
        <>
            {<Spinner />}   
            {<ModalGen data={getModalState} />}
          
            <div className="w2d_block">
                <nav aria-label="breadcrumb">
                    <ol className="breadcrumb breadcrumb-alt push">
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Buscador`}><small>Buscador</small></Link></li>
                        <li class="breadcrumb-item"> <small>Migraci贸n</small></li>
                    </ol>
                </nav>
            </div>

            <div className="block block-themed">
                <div className="block-header">
                    <h3 className="block-title">Proceso de migraci贸n</h3>
                </div>

                <div className="block-content">

                    {procesoDisciplinario()}
                    
                    <div className="col-md-12">

                        <table class="table">
                            <thead>
                                <tr>
                                    <th scope="col">#</th>
                                    <th scope="col">Fase</th>
                                    <th scope="col">Acciones</th>
                                </tr>
                            </thead>
                            <tbody>
                                                    
                            </tbody>
                        </table>
                        
                    </div>
                </div>
                
            </div>

                   
        </>
    );
}


export default AntecedentesMigracionLista;
